import { __decorate } from "tslib";
import { Component } from '@angular/core';
import { MODALS } from '../home/home.component';
let DatabaseViewComponent = class DatabaseViewComponent {
    constructor(webApiService, route, httpProvider, modalService) {
        this.webApiService = webApiService;
        this.route = route;
        this.httpProvider = httpProvider;
        this.modalService = modalService;
        this.databaseDetail = [];
        this.tableList = [];
    }
    reload() {
        this.getdatabaseDetailByName();
    }
    ngOnInit() {
        this.databaseName = this.route.snapshot.queryParams['database'];
        this.getdatabaseDetailByName();
    }
    async getdatabaseDetailByName() {
        this.webApiService.get('api/database/' + this.databaseName).subscribe(data => {
            if (data !== undefined) {
                console.log(data.body);
            }
            this.tableList = data.body;
        });
    }
    deleteTableConfirmation(tableId) {
        this.modalService.open(MODALS['deleteModal'], {
            ariaLabelledBy: 'modal-basic-title'
        }).result.then((result) => {
            alert(tableId + ' table deleted');
        }, (reason) => { });
    }
};
DatabaseViewComponent = __decorate([
    Component({
        selector: 'app-database-view',
        templateUrl: './database-view.component.html',
        styleUrls: ['./database-view.component.scss']
    })
], DatabaseViewComponent);
export { DatabaseViewComponent };
